import Cv from '../CvFiles/CV.pdf';
import EnglishCv from '../CvFiles/Cv_english.pdf';

const Contact = () => {
    return (
        <div className='topicInfo'>
            <h2 className='techTitle'>CV</h2>
            {/* <ScrollLink to="mywork" smooth={true}> */}
                <button className={`btn`}>
                    <a href={EnglishCv} target="_blank" rel="noopener noreferrer">Click here for my pdf</a>
                </button>
            {/* </ScrollLink> */}
        </div>
    );
};

export default Contact;
